import React from 'react';

const NavBar = () => {
    return (
        <React.Fragment>
            <nav id="navbar">
                <a href='/' id="logo">CurlyB</a>
                <div id="">
                    <ul>
                        <li><a href='/'>Home</a></li>
                        <li><a href='/'>Blogs</a></li>
                        <li><a href='/'>Login</a></li>
                        <li><a href='/'>Sigup</a></li>
                    </ul>
                </div>
            </nav>
        </React.Fragment>
    );
}

export default NavBar;
